import React, { useState } from 'react';
import Counter from './components/counter';

function App() {
  let[value, setValue] = useState("text")

  return (
    <div className="App">
      <Counter/>
      <h1>{value}</h1>
      <input 
      type="text" 
      value={value}
      onChange={event => setValue(event.target.value)}
      />
    </div>
  );
}

export default App;
